import React from 'react'

const Homepage = () => {
  return (
    <div className=''>
        <div className='h-20 border border-black'></div>
        <div className='flex justify-center mb'>

        <img className='h-40 border border-black rounded-full' src="https://www.aquasafemine.com/wp-content/uploads/2018/06/dummy-man-570x570.png" alt="" />
        </div>
        <span className='font-bold'>Gayathri Krishna</span>

    </div>
  )
}

export default Homepage
